INSERT INTO `Organization` VALUES (1962,10627010,'Next Level Church Inc','12400 Plantation Rd','','Fort Myers','FL','33966','USA','','Set Free To Be\nWe live in freedom by knowing who we are in Christ.\n\nStrive To Thrive\nWe passionately pursue our relationship with God.\n\nBetter Together\nWe are known, loved and challenged through authentic relationships.\n\nServe All, Love All\nWe use our gifts to serve others with the love of Jesus.\n\nLive To Give\nWe generously steward what we\'ve been given.','','http://www.nextlevelchurch.com/','https://www.facebook.com/nextlevelswfl/','',2002),(1963,10924051,'American Family Foundation Inc','5569 Salem Square Dr S','','Palm Harbor','FL','34685','USA','(727) 599-1115','Our mission is to serve the physical and emotional needs of homeless veterans, destitute children and families in crisis, and abused and neglected senior citizens.','','https://www.americanfamilyfoundationinc.com/','','',2010),(1964,16023519,'Bay Chamber Concerts, Inc','18 Central St.','5th floor','Rockport','ME','4856','USA','207-236-2823','Our mission is to enrich the lives of people in our community through high-quality concert programs, music education and community engagement.','','https://www.baychamberconcerts.org/','Bay Chamber Concerts & Music School','Bay Chamber',1961),(1965,20790880,'Creative Theatre Workshop Inc','8506 Sumner Ave.','','Fort Myers','FL','33908','USA','(239) 738-3525','The Creative Theater Workshop, Inc. is a community based non-profit organization that encourages and promotes an interest in the theatrical arts by providing workshops and producing full-length musical productions in order to educate, entertain, and enrich the community.','','','','',2009),(1966,30551791,'Beacon of H.O.P.E. Pine Island, Inc.','5090 Doug Taylor Circle','','St. James City','FL','33956','USA','239-283-5123','To improve the lives of those who live in the Greater Pine Island area by fulfilling a need, giving a pathway upward or by volunteering to help others.','','https://beaconofhopepineisland.com/','beaconofhopepineisland','',2006),(1967,41564655,'Massachusetts General Hospital (HomeBase)','PO Box 422','','Estero','FL','33929','USA','2397702414','Mass General was founded to serve our neighbors and those in need, a commitment that is just as strong at Mass General today as it was two centuries ago; the only difference is what it means to be a “neighbor.” Our community today extends far beyond Boston’s border. We partner with communities both close to home and across oceans to build, improve and sustain health care delivery and increase the health and well-being of those who live and work in these communities.','','massgeneral.org','','',NULL),(1968,41564655,'Massachusetts General Hospital (HomeBase)','125 Nashua Street, Suite 540','Suite 540','Boston','MA','2114','USA','239-207-1465','Mass General was founded to serve our neighbors and those in need, a commitment that is just as strong at Mass General today as it was two centuries ago; the only difference is what it means to be a “neighbor.” Our community today extends far beyond Boston’s border. We partner with communities both close to home and across oceans to build, improve and sustain health care delivery and increase the health and well-being of those who live and work in these communities.','','massgeneral.org','Massachusetts General Hospital','MassGeneral News',NULL),(1969,42103580,'Presidents and Fellows of Harvard College','48 Quincy Street','','Cambridge','MA','2138','USA','617-495-7792','Governing board at Harvard University; meets with president to plan university activities and long-term planning','','https://www.harvard.edu/about-harvard/harvards-leadership/president-and-fellows-harvard-corporation','','',1650),(1970,42263040,'Dana-Farber Cancer Institute','450 Brookline Avenue','','Boston','MA','2115','USA','617-632-3000','The mission of Dana-Farber Cancer Institute is to provide expert, compassionate care to children and adults with cancer while advancing the understanding, diagnosis, treatment, cure, and prevention of cancer and related diseases. As an affiliate of Harvard Medical School and a Comprehensive Cancer Center designated by the National Cancer Institute, the Institute also provides training for new generations of physicians and scientists, designs programs that promote public health particularly among high-risk and underserved populations, and disseminates innovative patient therapies and scientific discoveries to our target community across the United States and throughout the world.','','https://www.dana-farber.org/','Dana-Farber Cancer Institute','Dana-Farber',1951),(1971,42600449,'MetroWest Humane Society','PO Box 1068','','Framingham','MA','1701','USA','508-875-3776','An advocate for animal welfare, MWHS focuses on the well-being of cats in the Metrowest Boston area, including finding loving homes or providing life-long care while educating the community and reducing the feral/stray cat population.','','metrowesthumanesociety.org','MetroWest Humane Society','',1976),(1972,43063382,'Irish International Immigration Center','One State Street,','Suite 800','Boston','MA','2109','USA','617-542-7654','Our welcome center provides a comprehensive, multi-service approach to supporting immigrant and refugee families from more than 120 different countries.Our legal, education and wellness services empower immigrant and refugee families. With our support, immigrants can reach stability, gain additional security, and build pathways towards success in their new homes.We maintain a strong connection to Ireland through an international learning exchange, which provides Irish students and graduates with the opportunity to gain professional skills and experience across the U.S.In line with our mission, we advocate for fair immigration legislation and just policies, and facilitate an intercultural program which promotes inclusion, diversity, and unity.','','riancenter.org','Rian Immigrant Center','Rian Immigrant Center',1989),(1973,43649766,'Bobby Nichols Fiddlesticks Charity Foundation','15391 Canongate Dr','','Fort Myers','FL','33912','USA','239-633-4579','Generate funds to return to the community via charitable contributions. These contributions have been earmarked for abused and at risk children. Recognize the contributions and accomplishments of Bobby Nichols, winner of 14 PGA Tour tournaments including the 1964 PGA Championship and 1974 Canadian Open. (Bobby has been a resident of Fiddlesticks since its inception.)','','https://nicholscup.org/','Bobby Nichols-Fiddlesticks Charity Foundation','',2002),(1974,43750678,'Atlanta Youth Tennis & Education Foundation','1200 Ashwood Parkway','Suite 500','Atlanta','GA','30338','USA','770-416-4333','AYTEF promotes tennis through free clinics  and low-cost  programs for Atlanta\'s youth. Through our teachers, volunteers and donors, we support academic achievement. AYTEF\'s comprehensive mentoring network gives all participants an advantage.','','https://www.aytef.org/','Atlanta Youth Tennis & Education Foundation','AYTEF',2003),(1975,60737286,'The Community Fund of Darien','P.O. Box 926','30 Old Kings Highway South','Darien','CT','6820','USA','203-655-8775','Founded in 1951, The Community Fund of Darien is a highly respected, professional nonprofit that plays a significant role in addressing health and human service needs in Darien, Norwalk, and Stamford through strategic leadership and grantmaking. Our mission is to enhance the capacity of the community to care for one another by:\n​\nassisting the community to identify and prioritize its needs;\nkeeping the community informed about efforts to meet those needs;\nproviding cost effective fundraising;\ndistributing funds to meet identified community needs;\nassuring accountability of grant recipients;\nfostering coordinated and cooperative efforts to deliver services\n\nThe Community Fund of Darien was founded almost 70 years ago and since that time, we have distributed over $20 million to local nonprofit organizations and community initiatives. In 1977, we became the Darien United Way & Community Council. In 2006 we successfully withdrew from the United Way system and returned to our local roots where we continue to serve as the safety net for our community.','','https://www.communityfunddarien.org/','The Community Fund of Darien','CommunityFundDarien',1951),(1976,113678086,'New Horizons of Southwest Florida, Inc','P.O. Box 111833','','Naples','FL','34108','USA','239-948-4146','Empower at-risk youth to reach their full potential through tutoring, mentoring and faith-building','','newhorizonsofswfl.org','New Horizons of Southwest Florida','New Horizons of SWFL',2002),(1977,116107128,'Environmental Defense Fund Incorporated','257 Park Avenue South','17th Floor','New York','NY','10010','USA','202-572-3298','Environmental Defense Fund\'s mission is to preserve the natural systems on which all life depends.','','https://www.edf.org/','Environmental Defense Fund','EDF',1967),(1978,131624102,'National Audubon Society, Inc','375 Sanctuary Road West','','Naples','FL','34120','USA','239-348-9151','Our mission is to protect the natural resources of Corkscrew Swamp Sanctuary, its surrounding watershed, and the Western Everglades, and influence Everglades restoration; for the benefit of birds, other wildlife, and people; through land management, science, education, restoration, and public policy advocacy.','','corkscrew.audubon.org','Audubon\'s Corkscrew Swamp Sanctuary','Corkscrew Swamp Sanctuary',NULL),(1979,131632516,'Greek Orthodox Archdiocese of America','','','','','','USA','','The mission of the Archdiocese is to proclaim the Gospel of Christ, to teach and spread the Orthodox Christian Faith, to energize, cultivate, and guide the life of the Church in the United States of America according to the Orthodox Christian Faith and Tradition.\n\nThe Greek Orthodox Church in America sanctifies the faithful through divine worship, especially the Holy Eucharist and other Sacraments, building the spiritual and ethical life of the faithful in accordance with the Holy Scriptures, Sacred Tradition, the doctrines and canons of the Ecumenical and local Councils, the canons of the Holy Apostles and the Fathers of the Church and of all other Councils recognized by the Orthodox Church.','','goarch.org','','',1942),(1980,131788491,'American Cancer Society','250 Williams Street NW','','Atlanta','GA','30303','USA','800-227-2345','The American Cancer Society’s mission is to save lives, celebrate lives, and lead the fight for a world without cancer.','','https://www.cancer.org/','American Cancer Society','American Cancer Society',1922),(1981,131854606,'Guiding Eyes for the Blind, Inc.','611 Granite Springs Rd','','Yorktown Hts','NY','10598','USA','800-942-0149','Guiding Eyes for the Blind provides guide dogs to people with vision loss. We are passionate about connecting exceptional dogs with individuals for greater independence. \nGuiding Eyes is a 501(c)(3) nonprofit organization with all services provided completely free of charge. At Guiding Eyes, we rely upon the contributions of our generous donors to fulfill our mission.\nWe work out of our Headquarters and Training Center in Yorktown Heights, New York, and our Canine Development Center in Patterson, New York.\nGuiding Eyes is an accredited member of the International Guide Dog Federation (IGDF), the organization that establishes worldwide standards for the breeding and training of guide dogs.','','guidingeyes.org','Guiding Eyes for the Blind','Guiding Eyes',1954),(1982,133433452,'Doctors Without Borders USA, Inc','40 Rector Street','16th Floor','New York','NY','10006','USA','212-679-6800','Médecins Sans Frontières/Doctors Without Borders (MSF) is a private international association founded in 1971. The association is made up mainly of doctors and health sector workers and is also open to other professions which might help in achieving its aims. Our mission is to provide lifesaving medical care to those most in need.','','https://www.doctorswithoutborders.org/','Doctors Without Borders/ Médecins Sans Frontières (MSF)','Doctors w/o Borders',1987),(1983,135562167,'Bank Street College of Education','610 W 112th Street','','New York','NY','10025','USA','212-875-4400','The mission of Bank Street College is to improve the education of children and their teachers by applying to the education process all available knowledge about learning and growth and by connecting teaching and learning meaningfully to the outside world. In so doing, we seek to strengthen not only individuals, but the community as well, including family, school, and the larger society in which adults and children, in all their diversity, interact and learn. We see in education the opportunity to build a better society.','','https://www.bankstreet.edu/','Bank Street College of Education','Bank Street College',1931),(1984,135613797,'American Heart Association, Inc.','9200 Estero Park Commons Blvd','Suite 7','Estero','FL','33928','USA','239-495-4900','To be a relentless force for a world of longer, healthier lives.','','https://www.heart.org/','','',1949),(1985,135644916,'Leukemia and Lymphoma Society, Inc','3 International Drive','Suite 200','Rye Brook','NY','10573','USA','800-955-4572','Cure leukemia, lymphoma, Hodgkin\'s disease and myeloma, and improve the quality of life of patients and their families.','','lls.org/suncoast','The Leukemia & Lymphoma Society','The Leukemia & Lymphoma Society',1949),(1986,135660870,'International Rescue Committee, Inc','122 E 42nd St','','New York','NY','10168','USA','212-551-3000','The mission of the IRC is to help people whose lives and livelihoods are shattered by conflict and disaster to survive, recover and gain control of their future.','','rescue.org','International Rescue Committee','IRC - International Rescue Committee',1933),(1987,141984462,'Talmadge Hill Community Church','870 Hollow Tree Ridge Road','','Darien','CT','6820','USA','203-966-2314','Our Mission: To know the love of God, and share it. The Talmadge Hill Community Church has ALWAYS appreciated a simple truth -- God’s Love belongs to everyone.  Yet everyday, basic rights and opportunities -- food, clothing, shelter, education, healthcare, and more -- are denied vast numbers of fellow human beings across the planet.  In the face of these realities, churches are called to respond. \n    \nThrough our Missions Committee, we seek to identify and channel support to a broad base of people in need (locally, nationally and internationally).  Our commitment is NOT only to financial support, but includes the important work of building relationships.  This commitment comes to life in the ongoing and varied hands-on opportunities offered to friends and families within the congregation.    \n\nAs a demonstration of the importance of outreach and the necessary call to service, our church commits 22% of the annual operating budget to missions.','','https://www.talmadgehill.org/','Talmadge Hill Community Church','',NULL),(1988,142006608,'Immokalee Haitian Free Methodist Church','PO Box 267','','Immokalee','FL','34143','USA','','To bring wholeness to the world through healthy biblical communities of holy people multiplying disciples, leaders, groups and churches.','','https://fmcusa.org/','','',1958),(1989,161068101,'The Upstate Foundation, Inc.','750 E Adams Street','CAB326','Syracuse','NY','13210','USA','315-464-4416','To improve the health of the communities we serve through education, biomedical research and health care. To receive and administer charitable gifts primarily for Upstate Medical University.','','https://www.upstatefoundation.org/','The Upstate Foundation','SUNY Upstate Medical',1976),(1990,200045175,'Airwaves for Jesus, Inc.','PO Box 61721','','Fort Myers','FL','33906','USA','239-274-9150','Airwaves For Jesus Inc was founded in 2004. Airwaves For Jesus Inc specializes in Religious Organizations. \"Listen Learn Live\"','','https://www.kingdom.fm/','','',2003),(1991,200777618,'Historic Organ Restoration Committee','2301 Boardwalk','','Atlantic City','NJ','8401','USA','609-402-9584','Historic Organ Restoration Committee is a 501c3 chartered by the state of New Jersey for the restoration and preservation of the two pipe organs of Historic Boardwalk Hall. In addition to the actual physical restoration of the instruments, HORC seeks to educate and increase awareness of the unique importance of these instruments as irreplaceable national treasures through programming and tours throughout the year.','','boardwalkorgans.org','Pipe Organs of Boardwalk Hall Atlantic City','HORC',2004),(1992,201498596,'Baby Basics of Collier County, Inc.','PMB#132','POBox 413005','Naples','FL','34101','USA','','Our mission is to provide and distribute diapers and kindness to over 525 babies of low-income, working families in Collier County and Bonita Springs.\n•   With your donations, we purchase diapers by the truckload.\n•   Volunteers move the diapers from the truck to storage and to our 12 distribution sites.\n•   Families are screened and referred to our program by local agencies.\n•   Once a month, qualified families come to the closest distribution site to pick up a free, month supply of diapers.\n•   Volunteers greet the families, help them select the proper size and provide information about the next distribution and other opportunities for supportive services.\n•   Parents enjoy the open and caring environment where they connect with volunteers and talk about their daily struggles and successes.\nA month’s supply of free diapers allows families to spend their limited resources on food, medicine or other necessities.  Babies have a better chance to thrive because they are dry and comfortable.','','https://babybasicscollier.org/','Baby Basics of Collier County','',2004),(1993,202123833,'Florida Immigrant Coalition Inc','2800 Biscayne Blvd','Suite 200','Miami','FL','33137','USA','(305) 571-7254','“FLIC transforms culture and shifts power to make Florida a true home for all.”','','https://floridaimmigrant.org/','https://facebook.com/FloridaImmigrantCoalition','https://twitter.com/flimmigrant',2005),(1994,202200129,'Cape Coral American Little League','301 SW 30th Terrace','','Cape Coral','FL','33914','USA','','Baseball Cape Coral','','https://www.capecoralamericanlittleleague.com/','','',NULL),(1995,204280502,'Maureen\'s Hope Foundation','44 Oswego Street','','Baldwinsville','NY','13027','USA','315-243-6918','The mission of Maureen’s Hope Foundation is to offer practical support and assistance to people facing the challenges of a cancer diagnosis or other life altering disease.When faced with a life altering diagnosis of cancer or other disease, patients have many needs that cannot be met by the medical community. Maureen’s Hope helps meet those needs by catering to individuals on a personal level. By providing gift baskets and services that offer comfort and strength, Maureen’s Hope helps to improve their quality of life.','','maureenshope.org','Maureen\'s Hope Foundation','Maureen\'s Hope',NULL),(1996,204616813,'Florida Cancer Specialists Foundation, Inc.','5204 Paylor Lane','','Sarasota','FL','34240','USA','941-677-7181','Providing non-medical, financial assistance to adults undergoing cancer treatment in Florida to allow them to focus on fighting cancer.\nA cancer diagnosis can change everything. For some,  it may mean the added stress of financial hardship. Florida Cancer Specialists Foundation is a 501(c)3 nonprofit organization that was created to help patients who need financial assistance while undergoing treatment. The Foundation allows those fighting cancer to concentrate on recovery rather than their overdue rent, mortgage, electric, or water bill.','','https://fcsf.org/','Florida Cancer Specialists Foundation','FCS Foundation',2006),(1997,205728349,'Sisters of the Holy Family of Nazareth','310 N. River Road','','Des Plaines','IL','60016','USA','847-298-6760','We, Sisters of the Holy Family of Nazareth (CSFN), are an international Roman Catholic congregation of vowed religious women dedicated to spreading the Kingdom of God’s love, particularly within families. We do this by serving families through active ministry in schools, hospitals, parishes, prisons and social service agencies. We also spread the Kingdom through our daily living in a community of prayer and commitment to God and the Holy Family.\n\nToday, this vision of Nazareth is being lived by some 1,200 sisters serving in 14 countries: Australia, Belarus, England, France, Ghana, Israel, Italy, Kazakhstan, Philippines, Poland, Russia, Spain, Ukraine, and the United States, We are joined by 700 lay associates.\n\nHoly Family Province, the U.S. province of the Sisters of the Holy Family of Nazareth, has some 210 sisters serving in Connecticut, Illinois, Michigan, Missouri, New York, Ohio, Pennsylvania, and Texas. The Provincialate is located in Des Plaines, IL, a Chicago suburb.','','https://nazarethcsfn.org','Sisters of the Holy Family of Nazareth in the USA','Nazareth Sisters',NULL),(1998,210635010,'Princeton Theological Seminary','64 Mercer St','P.O. Box 821','Princeton','NJ','8542','USA','609-497-7700','Thank you for choosing to support the Princeton Theological Seminary Annual Fund. PTS is grateful for the generosity of our Board of Trustees, alumni/ae,congregations and friends – a spirit of philanthropy that allows us to fulfill our mission of educating the next generation of Christian leaders who will change lives and make a difference in the world.','','https://inside.ptsem.edu/open/giving/give.aspx/','','',NULL),(1999,223019683,'Bayshore Center at Bivalve, Inc','2800 High St','','Port Norris','NJ','8349','USA','856-785-2060','Through the state’s official tall ship, the oyster schooner AJ Meerwald and an historic waterfront museum, the Bayshore Center at Bivalve will advance the understanding of the human impact on New Jersey’s aquatic environment through education, advocacy, and programming.','','https://www.bayshorecenter.org/','AJ Meerwald','AJ Meerwald',1988),(2000,223265213,'Atlanticare Health System Foundation','2500 English Creek Ave','','Egg Harbor Township','NJ','8234','USA','609-407-2300','We make a difference in health and healing, one person at a time, through caring and trusting relationships.','','https://www.atlanticare.org/','AtlantiCare','AtlantiCare',1993),(2001,231405603,'Miquon School','2025 Harts Ln','','Conshohocksen','PA','19428','USA','610-828-1231','The Miquon School treasures and celebrates childhood. We give our students time to play and grow. Our program and our environment encourage wonder, inquiry, independence, and discovery. We seek to create confident, life-long learners who will move out into the wider world with strong academic and social skills, intense personal interests, a love for the arts, and a commitment to building inclusive and peaceful communities. We are dedicated to learning together in the rich tradition of Progressive education that is our founders’ legacy.','','miquon.org','The Miquon School','The Miquon School',1932),(2002,231995911,'Geisinger Health','100 N Academy Ave','','Danville','PA','17822','USA','800-275-6401','Everything we do is about caring for our patients, our members, our students, our Geisinger family and our communities. Founded more than 100 years ago by Abigail Geisinger for her central Pennsylvania community, Geisinger has expanded and evolved to meet regional needs and developed innovative, national programs in the process.  We’ve become a coordinated intersection of services and providers – primary care and specialists, hospitals and trauma centers, insurance, medical education and research. Having all that working together makes it possible to do more to improve care, and test and share innovation that works – and that’s vital. But what makes Geisinger unique is the patients and communities who are the focus of everything – our essential partners.',