ion of the Foundation Fighting Blindness is to drive the research that will provide preventions, treatments and cures for people affected by retinitis pigmentosa, age-related macular degeneration, Usher syndrome and the entire spectrum of retinal degenerative diseases. The Foundation is a beacon for those affected by these blinding diseases. Join the fight and help us accelerate our mission.','','https://www.fightingblindness.org/','Foundation Fighting Blindness','Foundation Fighting Blindness',1971),(2008,237137529,'ACLU of Florida Foundation','4343 West Flagler Street','Suite 400','Miami','FL','33134','USA','','The American Civil Liberties Union (ACLU) is our nation’s guardian of liberty, working daily in courts, legislatures and communities to defend and preserve the individual rights and liberties guaranteed to all people in this country by the Constitution and laws of the United States.','','https://www.aclufl.org/en','ACLU of Florida','ACLU of Florida',1971),(2009,237160360,'Lee Healthcare Resources (Lee Memorial Hospital Inc)','9981 S Healthpark Dr','','Fort Myers','FL','33908','USA','239-343-6901','TO COOPERATE WITH LEE MEMORIAL HEALTH SYSTEM (LMHS) IN ITS MISSION TO PROVIDE HEALTHCARE SERVICES TO RESIDENTS OF SOUTHWEST FLORIDA AND TO COOPERATE WITH CYPRESS COVE AT HEALTHPARK FLORIDA, INC (CC) IN ITS MISSION TO PROMOTE THE WELL-BEING OF SENIOR CITIZENS RESIDING IN LEE COUNTY FLORIDA AND THE SURROUNDING AREA THROUGH SOUND BUSINESS STEWARDSHIP OF OUR RESOURCES AND BUSINESS ENTERPRISES.','','','','',NULL),(2010,237228287,'Helen Woodward Animal Center','PO Box 64','','Rancho Santa Fe','CA','92067','USA','858-756-4117','Helen Woodward Animal Center’s passionate belief that animals help people and people help animals through trust, unconditional love, and respect creates a legacy of caring. Sharing this philosophy with others, the Center inspires and teaches, locally and globally, the importance of the animal-human bond.','','animalcenter.org','Helen Woodward Animal Center','Helen Woodward',1972),(2011,237271040,'Clinic for the Rehabilitation of Wildlife, Inc','PO Box 150','','Sanibel','FL','33957','USA','239-472-3644','The Clinic for the Rehabilitation of Wildlife is a teaching hospital and visitor education center dedicated to saving wildlife through state-of-the-art veterinary care, research, education and conservation medicine.','','http://www.crowclinic.org/','CROW - Clinic for the Rehabilitation of Wildlife, Inc.','CROWClininc',1972),(2012,237275283,'ECHO, Inc','17391 Durrance Road','','North Fort Myers','FL','33917','USA','239-543-3246','Following Jesus by reducing hunger and improving lives worldwide through partnerships that equip people with agricultural resources and skills.','','https://www.echonet.org/','ECHO International','ECHO Fights Hunger',1973),(2013,237303117,'Florida Sheriffs Youth Ranches','PO Box 2000','','Boys Ranch','FL','32064','USA','800-765-3797','The mission of the Florida Sheriffs Youth Ranches is to prevent delinquency and develop lawful, resilient and productive citizens.','','https://www.youthranches.org/','Florida Sheriffs Youth Ranches','FLSheriffsYouthRanch',1973),(2014,237348129,'Cape Coral Art League, Inc.','516 Cultural Park Boulevard','','Cape Coral','FL','33910','USA','','The Cape Coral Art League enhances the quality of life in Cape Coral by engaging our diverse community in high-quality arts education and exhibitions.\n\nCCAL strengthens the fabric of our community by engaging youth in creative activities that develop discipline, problem-solving skills and decision-making, and give them a sense of achievement and personal worth.  Studies have shown that children who have an art education are better able to focus on their aspects of their education and score higher on tests.\n\nCCAL is a center for art education where children and adults can learn and develop their artistic skills.  All students are welcome here, from the complete novice to the professional.\n\nCCAL students become confident and seasoned in their accomplishments with others through our art in public places program, exhibitions and our open painting sessions, during which the artists create in a relaxed atmosphere and may request a critique of their work, gaining the insight of their artists in order to improve the quality of their art.\n\nCCAL faculty is comprised of professional, practicing artists who are experienced teachers.  The CCAL offers a diverse curriculum reflective of our changing society and then celebrates that diversity through exhibition.\n\nCCAL is an integral part of the community.  We offer in-depth arts education programs in our classrooms and present exhibitions in our gallery as well as many local venues.','','https://capecoralartleague.org/','','',1973),(2015,240772407,'Bucknell University','301 Market Street','Suite 2','Lewisburg','PA','17837','USA','570-577-2000','Bucknell is a unique national university where liberal arts and professional programs complement each other. Bucknell educates students for a lifetime of critical thinking and strong leadership characterized by continued intellectual exploration, creativity and imagination. A Bucknell education enables students to interact daily with faculty who exemplify a passion for learning and a dedication to teaching and scholarship. Bucknell fosters a residential, co-curricular environment in which students develop intellectual maturity, personal conviction and strength of character, informed by a deep understanding of different cultures and diverse perspectives. Bucknell seeks to educate our students to serve the common good and to promote justice in ways sensitive to the moral and ethical dimensions of life. Bucknell’s rich history and heritage will influence its planning for the future. Bucknell’s potential as an institution of higher learning extends beyond that of a traditional liberal arts college by virtue of its larger size and expansive programs. The University’s broad spectrum of disciplines and courses of study within a diverse and active residential campus community enhances the quality of all aspects of the undergraduate experience, both in and out of the classroom.','','https://www.bucknell.edu/','BucknellU','Bucknell University',1846),(2016,261964620,'Blessings in a Backpack SWFl','P.O. Box 61402','','Fort Myers','FL','33906','USA','239-410-9592','Blessings in a Backpack is a 501 C (3) non-profit organization currently feeding over 83,000 children 900 schools in 46 U.S. states and the District of Columbia. The program is a hybrid of private sector funding and public partnership carried out in schools. We are feeding the future of America, one school at a time.','','https://blessingsinswfl.org/','BlessingsinSWFL','BlessingsSWFL',2008),(2017,262302491,'SWFL Children\'s Charities, Inc','2031 Jackson Street','Suite 110','Fort Myers','FL','33901','USA','239-433-4260','SWFL Children’s Charities, Inc. is a local nonprofit organization that is dedicated to saving children’s lives by supporting the region’s growing pediatric health care system. Under the leadership of its Board of Directors and with the passionate and generous support of its Trustees, SWFL Children’s Charities has donated nearly $23 million to local pediatric health care initiatives over the past eleven years. These vital funds are raised through one of the most important fundraising events the region, Southwest Florida Wine & Food Fest.','','https://swflwinefest.org/mission-and-board/','Southwest Florida Wine & Food Fest','SWFL Wine-Food Fest',2008),(2018,262553174,'Noah\'s Arks Rescue','4084 Spring Island','','Okatie','SC','29909','USA','843-540-6755','Noah\'s Arks Rescue is a 501c3 not for profit organization that supplies emergency medical, surgical and rehabilitation to abused animals. We are not a shelter.  Our wish and lifelong hope is that our Society becomes educated in the ethical treatment of all animals and to stop the senseless killing of animals that have been tortured and abused.','','noahs-arks.net','','',2008),(2019,262855304,'Art Quilters Unlimited','5279 Stratford Court','','Cape Coral','FL','33904','USA','','Art Quilters Unlimited is a group of artists interested in sharing fiber arts knowledge, supporting creativity through workshops, and expanding the appreciation of our work with community and regional exhibits. All are welcome - From novice to expert.','','http://artquiltersunlimited.com/','','',2015),(2020,263631295,'Moorings Park Foundation','120 Moorings Park Dr','','Naples','FL','34105','USA','239-317-8765','As a member of the Naples community, Moorings Park proudly notes its Social Accountability Program designed to identify and improve unmet needs of the area we serve. As such, we support dozens of community health initiatives by distributing grants to local non-profit and public health agencies.','','mooringspark.org','Moorings Park Communities','Moorings Park',2008),(2021,264577956,'Lee County Homeless Coalition','1500 Colonial Blvd','Ste 235','Fort Myers','FL','33907','USA','239-322-6600','Our mission is “to advocate, educate, and promote awareness of issues and obstacles facing homeless individuals in Lee County through community collaboration, planning, and implementing solutions.”','','leehomeless.org','Lee County Homeless Coalition, Inc.','',2008),(2022,270153653,'Home at Last Dog Rescue, Inc','PO Box 1341','','North Wales','PA','19454','USA','215-817-2923','We are a group of volunteers whose goal is to save the lives of homeless dogs suffering in high-kill shelters, as well as owner-surrender dogs who need to be re-homed due to unfortunate circumstances. We are not a shelter, and we have no central location for the dogs we rescue. We pull dogs from various shelters and provide foster homes until they are adopted. In doing so, we hope to provide an alternative to the purchase of puppy mill and pet store dogs, thereby reducing the demand for, and ultimately, the supply of, such dogs. We strive to match each dog with the right family after the dog has been observed in a foster home.','','homeatlastdogrescue.com','Home at Last Dog Rescue','',2009),(2023,270526903,'Laboratory Theater of Florida, Inc','1634 Woodford Ave','','Fort Myers','FL','33902','USA','239-218-0481','THE LABORATORY THEATER OF FLORIDA is dedicated to the promotion of the performing arts, through live performance, education, community outreach, experimentation and the development of ensemble work.','','laboratorytheaterflorida.com','The Laboratory Theater of Florida','Laboratory Theater',2011),(2024,270526903,'The Laboratory Theater of Florida','1634 Woodford Ave','','Fort Myers','FL','33901','USA','239-218-0481','The Laboratory Theater of Florida, a 501(c)3 nonprofit organization, is dedicated to the promotion of the performing arts, through live performance, education, community outreach, experimentation and the development of ensemble work. The company features ensemble productions, produces classic works, takes artistic risks and features and challenges local performers.','','http://www.laboratorytheaterflorida.com','The Laboratory Theater of Florida','Laboratory Theater',2011),(2025,271801635,'Family Promise North Shore Boston, Inc','330 Rantoul Street','','Beverly','MA','1915','USA','978-922-0787','Family Promise North Shore Boston aims to return newly homeless families to economic self-sufficiency, while serving each family that experiences homelessness in  a manner that embraces the dignity and strength of the family. We are committed to keeping families together during their time of homelessness and to helping them through the process of finding support and housing.\n','','https://www.familypromisensb.org/','Family Promise North Shore Boston','',2011),(2026,271988145,'Catholic Charities Diocese of Venice, Inc','1000 Pinebrook Road','','Venice','FL','34285','USA','941-484-9543','In devotion and adherence to the teachings of Jesus and the Catholic Church, we seek to serve and empower ALL in need regardless of race, nationality or creed.','','https://dioceseofvenice.org/','CatholicCharitiesDioceseOfVenice','CC_DOV',1984),(2027,273385763,'Golden PAWS Assistance Dogs','3173 Horseshoe Drive South','','Naples','FL','34104','USA','(239) 775-1660','Mission and Vision Statement: Golden PAWS Assistance Dogs is a 501c3 nonprofit organization that promotes independence for combat wounded veterans and children with life-changing disabilities through partnerships with skilled assistance dogs, at no cost to the recipient. Golden PAWS Assistance Dogs are always placed at no cost to those they serve. Golden PAWS Assistance Dogs provides education and community outreach in support of the mission through therapy and ambassador dog programs. Golden PAWS Assistance Dogs is a respected and sustainable organization that creates meaningful impacts for service dog recipients while making lasting contributions in support of our community and those we serve. Our extraordinary Goldens are the common denominator in all our work.','','http://www.goldenpaws.org/','https://facebook.com/PAWSNaples','https://twitter.com/PAWSDogs_Naples',2013),(2028,274011343,'News Literacy Project Inc','5335 Wisconsin Avenue NW,','Suite 440','Washington','DC','20015','USA','','The News Literacy Project (PDF) is a national education nonprofit offering nonpartisan, independent programs that teach students how to know what to trust in the digital age.','','newslit.org','The News Literacy Project','The News Literacy Project',2010),(2029,274816668,'De LaSalle Academy of Fort Myers Inc','6401 Techster Boulevard','','Fort Myers','FL','33966','USA','239-245-8212','De LaSalle Academy educates children with special needs, providing a safe, supportive, and nurturing environment, where each student’s diverse ability is honored and valued.','','https://delasallefm.org/','De LaSalle Academy of Ft Myers','',2011),(2030,300437443,'Hope Clubhouse of Southwest Florida, Inc','3602 Broadway','','Fort Myers','FL','33901','USA','239-267-1777','Hope Clubhouse is a community of support for adults living with a mental illness which provides opportunities for paid employment and access to education, housing and wellness.','','hopeclubhouse.org','Hope Clubhouse of Southwest Florida','',2007),(2031,300574823,'Eco-Voice Inc','16992 Curry Preserve','','Punta Gorda','FL','33982','USA','','Eco-Voice, Inc. is a non-partisan, independent communication portal for individuals interested in the issues impacting the south Florida environment.','','http://www.eco-voice.org/','https://www.facebook.com/EcoVoice.org/','',2010),(2032,310537167,'Young Womens Christian Association of Hamilton Ohio','244 Dayton Street','','Hamilton','OH','','USA','','Established in 1858 as a voice for women\'s issues, we opened the first employment bureau for women several years later. That was only the beginning of more than 150 years of active advocacy and programming for women\'s rights and civil rights.\n\nWe continue to evolve to meet today\'s challenges in eliminating racism and empowering women. We\'ve shifted to a bottoms-up, grassroots structure. We\'ve launched a revitalized brand that reaffirms the mission of working aggressively for women and people of color. And we\'re engaging women 18- to 34-years old to carry on the YWCA mission for years to come.\n\nThe YWCA advocacy issues reflect our mission and the values of our organization. We promote solutions to improve the lives of women, girls and people of color across the country.\n\nFrom lobbying for pay equity and hate crimes legislation to the increased funding for Head Start and the Violence Against Women Act, the YWCA advocates on Capitol Hill while employees and volunteers empower women and girls in our communities.','','https://www.ywcahamilton.com/','','',NULL),(2033,311101788,'Disabled American Veterans','25363 Paladin Ln','','Punta Gorda','FL','33983','USA','','Assist Veterans','','','','',1942),(2034,311536036,'Florida Arts, inc.','2301 First Street','','Fort Myers','FL','33901','USA','239-333-1933','The Sidney & Berne Davis Art Center, run by Florida Arts, Inc. (a 501c3 organization), is a must-see attraction with a colorful history. The center is dedicated to bringing world-class art events to the Southwest Florida community. Within our restored, state-of-the-art facility, we present a wide range of events to the public. From concerts to art exhibitions, galas to lectures, and providing educational arts experiences for children and adults alike– we promise excellence!','','https://www.sbdac.com/','The Sidney & Berne Davis Art Center','SBDAC',2008),(2035,320033325,'Operation Homefront','1355 Central Parkway S','St. 100','San Antonio','TX','78232','USA','210-659-7756','Build strong, stable, and secure military families so they can thrive in the communities that they’ve worked so hard to protect.','','operationhomefront.org','Operation Homefront','Operation Homefront',2002),(2036,320287310,'Blood Donors of America','1298 Bradford Dr','','Coppell','TX','75019','USA','','The Blood Donors of America (BDA) is a non-profit, non-religious, non-political and charitable organization. It is dedicated to community service primarily by hosting blood drives and creating awareness of blood donations. Besides blood drives, BDA is also working on the bone marrow matching campaigns, and health education (healthy diet, physical fitness, obesity, free health screening, and health awareness consultation). We have a target of organizing blood drives over all fifty states in the USA and beyond. Our dedicated voluntary teams are working hard to coordinate with all national, regional, and state level community organizations, student associations as well as individuals in the community to participate in donating the most precious gift of life – blood saves lives in need. One pint of your blood is above and beyond any kind of donation because it has the potential to save three lives.','','http://blooddonorsofamerica.org/','','',NULL),(2037,330215585,'Alpha Project for the Homeless','3737 5th Avenue','Ste 203','San Diego','CA','92103','USA','619-542-1877','The mission of the Alpha Project is to empower individuals, families, and communities by providing work, recovery and support services to people who are motivated to change their lives and achieve self-sufficiency. The agency’s many programs are available to all persons in need regardless of race, creed, color, ethnicity, national origin, religion, gender, or sexual orientation.\nAlpha Project strives not to manage homelessness, but rather to end it for its clients by offering jobs not handouts, respect not pity and empowerment not control. We provide the homeless with the tools they need to be the very best they can be.\nEach program offered by the Alpha Project focuses on assisting participants to attain their own optimal level of independence. For most of our program participants, successful completion of our programs will mean complete and permanent independence through education, employment, sobriety, and stability. For those clients with special needs, our programs maximize their own potential and supports as much independence as possible. All of our clients regardless of their history are encouraged, supported, and assisted in reaching their maximum potential with dignity and respect.','','https://www.alphaproject.org/','Alpha Project','',1987),(2038,330776828,'Far Reaching Ministries','38615 Calistoga Dr','Suite 100','Murrieta','CA','92563','USA','951-677-4474','Far Reaching Ministries (FRM), founded in 1998, is an evangelical Christian missionary and humanitarian 501(c)(3) organization. Ongoing funding and support is provided by individuals, churches, businesses and private foundations.\nIn 1996, Pastor Wes Bentley, Founder and CEO of Far Reaching Ministries (FRM), began serving as a missionary in the war torn regions of Bahr El-Ghazal, Western Equatoria, and the Nuba Mountains (Southern Kordofan). Two years later, FRM began working with South Sudanese refugee camps, primarily in Kiryandongo, Uganda. Offering love and hope to orphans and widows who had lost their families, FRM served the physical, emotional, and spiritual needs of those most affected by ethnic and religious cleansing.','','https://frmusa.org/','Far Reaching Ministries','',1998),(2039,356042135,'Allen County Society For The Prevention Of Cruelty To Animals','4914 S. Hanna Street','','Fort Wayne','IN','46806','USA','260-744-0454','The Allen County SPCA will promote the prevention of cruelty to animals by providing a safe haven for animals, an effective and comprehensive adoption program, education and outreach programs for the community and deep and broad membership and volunteer programs.','','https://www.allencountyspca.org/','Allen County SPCA','AllenCountySPCA',1949),(2040,362193608,'Shriners Hospitals for Children','2900 Rocky Point Drive','','Tampa','FL','33607','USA','800-237-5055','Shriners Hospitals for Children has a mission to:\n\nProvide the highest quality care to children with neuromusculoskeletal conditions, burn injuries and other special healthcare needs within a compassionate, family-centered and collaborative care environment.\nProvide for the education of physicians and other healthcare professionals.\nConduct research to discover new knowledge that improves the quality of care and quality of life of children and families.\nThis mission is carried out without regard to race, color, creed, sex or sect, disability, national origin, or ability of a patient or family to pay.\n\nOur vision\nBecome the best at transforming children’s lives by providing exceptional healthcare through innovative research, in a patient and family-centered environment.','','https://www.shrinershospitalsforchildren.org/shc','Shriners Hospitals for Children','Shriners Hospitals',1925),(2041,362216167,'Lake Forest Academy','1500 W Kennedy Rd','','Lake Forest','IL','60045','USA','847-615-3210','Lake Forest Academy strives to embody in its practices and to cultivate in its students excellence of character, scholarship, citizenship, and responsibility.\n \nCharacter encompasses respect for others and their beliefs, dedication to honesty in every sphere of life, realization of moral clarity and conviction, and pursuit of virtue and value in life.\n\nScholarship encompasses acquisition of knowledge, development of critical thinking, enthusiasm for discovery and learning, and exercise of a powerful imagination.\n\nCitizenship encompasses appreciation of diversity and multiculturalism, involvement in the LFA community, participation in service to others, and commitment to global awareness and understanding.\n\nResponsibility encompasses development of self-reliance, ability to seek guidance, dedication to cooperation and teamwork, and action based upon informed decisions.','','lfanet.org','Lake Forest Academy','Lake Forest Academy',1857),(2042,362512404,'Lincoln Park Zoological Society','2001 N Clark St','','Chicago','IL','60614','USA','312-742-2000','Lincoln Park Zoo is dedicated to connecting people with nature by providing a free, family-oriented wildlife experience in the heart of Chicago and by advancing the highest quality of animal care, education, science and conservation.','','lpzoo.org','Lincoln Park Zoo','Lincoln Park Zoo',1959),(2043,363820916,'JourneyCare Foundation','2050 Claire Court','','Glenview','IL','60025','USA','224-770-2489','At JourneyCare Foundation, we hold on to the dream that end-of-life care will be available to all who can benefit. Your donation to the JourneyCare Foundation will help ensure that JourneyCare can continue providing compassionate, exceptional care to patients and families throughout our service area for years to come, and that everyone who is in need of our services receives the support they need, regardless of their ability to pay.','','journeycare.org/journeycare-foundation/','JourneyCare','JourneyCare',1992),(2044,364736711,'Heights Foundation, Inc','15570 Hagie Dr','','Fort Myers'