tment without the use of opioids to low-income, uninsured people who suffer from acute and chronic pain, using holistic principles and compassionate Biblical values. We are the only free pain clinic in Florida, in fact, the only one we are aware of in the US. We offer a unique treatment model that is otherwise unavailable to our patients who lack financial means and insurance. We provide free medical and chiropractic care, acupuncture, physical and massage therapy, modalities, and lifestyle, exercise and nutrition education to treat patients\' pain at the source without the use of prescription pain medications. This model creates a path toward healing, rather than drug abuse.','','https://freepainclinic.org','The Southwest Florida Free Pain Clinic','',NULL),(2068,472641606,'SW Florida Free Pain Clinic','6900 Daniels Parkway, Suite 29-393','','Fort Myers','FL','33912','USA','239-308-7107, 239-989-5155','Southwest Florida Free Pain Clinic helps restore hope for low income, uninsured patients through comprehensive evaluations and treatment plans using holistic, compassionate, and opioid-free care.','','https://freepainclinic.org/','','',2015),(2069,472821242,'Wellfit Girls Program SWFL, Inc.','2430 Vanderbilt Beach Rd','#175','Naples','FL','34109','USA','239-529-0366','The Mission of Wellfit Girls\nIs to inspire, challenge and empower teen girls to climb high in all areas of life through transformational leadership programs.','','https://wellfitgirls.org/who-we-are/','Wellfit Girls','',2015),(2070,473563908,'Bonita Bay Veterans Council','C/O Romano 3330 Riverpark Court','','Bonita Springs','FL','34134','USA','','To provide assistance to local veterans and their families who are in need of our help.','','https://www.bbveteranscouncil.org/home','','',2015),(2071,473668886,'Veteran Barn Door Project Inc','14642 Aeries Way Drive','','Ft Myers','FL','33912','USA','(802) 917-3550','To bring trust and balance to the lives of veterans suffering with the hidden wounds of war th