nd families of ill and injured veterans.','','https://cst.dav.org/','','',1986),(2083,530239013,'League of Women Voters Education Fund','18 Georgetown','','Fort Myers','FL','33919','USA','','The League of Women Voters Education Fund conducts voter service and citizen education activities. It is a nonpartisan nonprofit public policy educational organization, which: \n\n- Builds citizen participation in the democratic process.\n- Studies key community issues at all government levels in an unbiased manner.\n- Enables people to seek positive solutions to public policy issues through education and conflict management.','','my.lwv.org/florida/lee-county/education-fund','','',NULL),(2084,530242992,'Greater Washington Educational Telecommunications Assoc., Inc','3939 Campbell Avenue','','Arlington','VA','22206','USA','703-998-2600','WETA\'s mission is to produce and distribute content of intellectual integrity and cultural merit using a broad range of media to reach audiences both in our community and nationwide. We leverage our collective resources to extend our impact. We will be true to our values; and we respect diversity of views, culture and heritage.','','weta.org','WETA','WETA',1953),(2085,541512177,'Center for Public Integrity','910 17th Street, NW','7th Floor','Washington','DC','20006','USA','(202) 466-1300','We are a nonpartisan, nonprofit investigative newsroom that focuses on the influence of money and growing inequality on our democracy. Public Integrity collaborates with national and local newsrooms to report and distribute stories. We support local journalism by providing data and reporting tools to help produce in-depth reporting.','','https://publicintegrity.org/','https://facebook.com/publici','https://twitter.com/Publicintegrity',1993),(2086,542083697,'Friends of the Fort Myers Library','2450 First St','Apt 2608','Fort Myers','FL','33901','USA','239-485-1162','Many of the young families who patronize the library have limited resources. Our library is a source of structured entertainment, reading activities, and recreation for their youngsters. Seniors in our community come to the library for books, for educational programs and for entertainment. The Friends make it possible for these services to be offered FREE to our community.','','fortmyersfriends.org','','',2002),(2087,561325184,'Council for Children\'s Rights, Inc.','601 E 5th St','Suite 510','Charlotte','NC','28202','USA','704-943-9609','We improve the lives and futures of children in Mecklenburg County through legal representation, individual advocacy, and by addressing community-wide issues through research and policy work.','','https://www.cfcrights.org/','Council for Children\'s Rights','CFCRights',1979),(2088,561627401,'Global Scholars','100 E. Park','Suite 206','Olathe','KS','66061','USA','913-962-4422','Global Scholars is called to equip missional Christian academics to have a redemptive influence among their students, colleagues, universities, and academic disciplines.\n\nOur vision is that one day every student, colleague, university, and discipline will have Christian professors who communicate the truth, goodness, and beauty of Christ in the power of the Spirit for the flourishing (shalom) of society as they serve Christ in global higher education.','','global-scholars.org','Global Scholars','GlobalScholars',1988),(2089,561883637,'Literacy Council of Highlands, Inc.','348 S. 5th Street','','Highlands','NC','28741','USA','','The mission of The Literacy Council is to enrich lives and expand the knowledge of children, adults and families through diverse educational programs that advance literacy in its many forms and to promote lifelong learning, which results in an informed and empowered community.','','maconncliteracy.org','','',1997),(2090,561891135,'The Lutheran Church of the Good Shepherd','22 Fisher Road','','Brevard','NC','28712','USA','828-883-3680','Called by God’s grace and led by the Holy Spirit to proclaim Jesus Christ Savior of all, we receive the assurance of that grace through Word and Sacrament.\nThrough worship, learning and fellowship the Spirit empowers us to share God’s love and grow in faith.\nWe welcome everyone, reach out in witness and with compassion, serve our community and the world.','','https://lutheranchurchbrevardnc.com/','Lutheran Church of the Good Shepherd','',NULL),(2091,562093546,'Bascom Corporation','323 Franklin Rd','','Highlands','NC','28741','USA','828-526-4949','The Bascom creates visual art experiences that inspire and empower individuals and communities through seeing, thinking, and doing.','','http://www.thebascom.org/','The Bascom: A Center for the Visual Arts','',1998),(2092,566060841,'Highlands Community Theatre, Inc (DBA Highlands Playhouse)','PO Box 896','','Highlands','NC','28741','USA','828-526-2695','Highlands Playhouse, one of the country’s oldest professional summer stock theaters, is the legacy of Highlands’s early forward-thinking families. The first troupe, all amateurs, began using the Highlands School auditorium in the mid-1930s.  “Even to this day,” writes historian Randolph Shaffner, “the acoustics are nearly perfect.” They formally organized in the late 1930s as the Highlands Little Theatre, which was ultimately renamed Highlands Playhouse. The first big production was the Broadway comedy “Dulcy.” Reserved seats cost 50¢. Bleacher seats were 35¢.  And it was a sell out crowd. Over the years, the local ensemble began to bring in professionals and mounted sophisticated plays by important authors: Molière, Ionesco, George Bernard Shaw, and Thornton Wilder. Highlands Playhouse has its share of distinguished alumni. Collin Wilcox, a regular on the local stage, went on to play opposite Gregory Peck in the film “To Kill A Mockingbird,” as Mayella.\n\nToday, Playhouse Theatre, with 3-4 plays each summer, is still a springboard for local drama students to hone their skills alongside professional mentors.  For children, the Playhouse Theater Summer Camp offers fun, hands-on exposure to the magical experience of writing and performing a play. And off-season, the performance space becomes a movie theatre for first-run films. Highlands Playhouse will soon have a new home − joining other cultural organizations in the newly expanded Performing Arts Center.  The theater will seat as many as 350, with state-of-the-art sound and lighting.  The curtain is expected to go up in 2020.','','highlandsplayhouse.org','Highlands Playhouse','Highlands Playhouse',1949),(2093,570794782,'Tricounty Family Ministries','2105 Cosgrove Avenue','','North Charleston','SC','29405','USA','843-747-1788','Tricounty Family Ministries began in 1983 as a humble soup kitchen providing bagged lunches to the hungry. Obviously, meeting the basic human needs for survival is only the beginning point of our organization. Clients come to our Center in need of food, clothing, or shelter. We meet those basic needs and work with them to understand the cause of the crisis in their lives and then open the doors to opportunities throughout our array of onsite programming and extensive referral network. At Tricounty Family Ministries, clients are not a number; clients are individuals deserving respect and care.','','https://www.tricountyfamilyministries.org/','Tricounty Family Ministries','Tricountyfamilyministries',NULL),(2094,571095108,'Darkness to Light','1064 Gardner Road','Suite 210','Charleston','SC','29407','USA','843-965-5444','Darkness to Light empowers adults to prevent, recognize, and react responsibly to child sexual abuse through awareness, education, and stigma reduction.\nOur work is guided by the vision of a world free from child sexual abuse. We envision a world in which adults form prevention-oriented communities that protect the child’s right to a healthy childhood.\nWe believe that protecting children is an adult’s responsibility, and that through education and training adults will be empowered to act. Our trainings are the only evidence-informed, adult-focused child sexual abuse prevention trainings proven to increase knowledge and change behavior. Our work empowers adults and organizations to bring in child safety to their own communities.','','https://www.d2l.org/','Darkness to Light','Darkness2Light',2000),(2095,571116978,'Water Mission','P.O. Box 71489','','North Charleston','SC','29415','USA','843-769-7395','To honor God by developing, implementing, and sharing best-in-class safe water solutions that transform as many lives as possible, as quickly as possible.','','https://watermission.org/','Water Mission','Water Mission',2001),(2096,580566256,'Emory University','1762 Clifton Rd','Suite 1400','Atlanta','GA','30322','USA','404-727-2827','Emory University\'s mission is to create, preserve, teach, and apply knowledge in the service of humanity.','','http://www.emory.edu/home/index.html','Emory University','Emory University',1836),(2097,580660607,'Salvation Army of Lee, Hendry, and Glades Counties','10291 McGregor Boulevard','','Fort Myers','FL','33919','USA','239-278-1551','Mission Statement: The Salvation Army, an international movement, is an evangelical part of the universal Christian church. Its message is based on the Bible. Its ministry is motivated by the love of God. Its mission is to preach the gospel of Jesus Christ and to meet human needs in His name without discrimination.\n\nSummary: In over 124 countries worldwide, The Salvation Army preaches the gospel, spreads the Christian truths, provides basic human necessities, such as food, clothing, and shelter to all without any restrictions or limitations whatsoever, promotes community-based initiatives that improve living conditions and increase skills in poor communities, and works to promote spiritual, moral, and physical well-being of all mankind.','','https://salvationarmyflorida.org/fortmyers/#about-us','The Salvation Army of Florida','Salvation Army Florida',NULL),(2098,580660607,'Salvation Army of Naples, Florida','PO Box 8209','','Naples','FL','34101','USA','','The Salvation Army officially dedicated the Naples Corps on February 1, 1981, and the Naples Family Services Center at the Estey Avenue campus was dedicated on January 24, 1993. We also have an Immokalee Social Services office to help our neighbors in need.\n\nOriginally serving the community with a Family Shelter, Emergency Social Services and Disaster Services, the Naples Corps 2004 feasibility study determined a need for additional Child Care options, and the Family Shelter became our Child Development Center. The center offers affordable daycare for children ages 1 through 5. The Fran Cohen Youth Center opened in April 2017, serving elementary through sixth-grade students with after-school and summer day camp programs.\n\nThe Salvation Army Naples serves all of Collier County and is actively meeting human needs without discrimination. We invest in our community by investing in individuals, not only meeting short-term basic needs but providing a caring continuum of services to the families and individuals we serve. We offer many unique and comprehensive programs to meet basic needs that are evident across the county.\n\nMinistry to the whole person – body, mind and spirit – are the hallmarks of the services offered by The Salvation Army. We see a need and try to meet that need.','','https://salvationarmyflorida.org/naples/','','',NULL),(2099,590694358,'Naples Community Hospital Inc','PO Box 413029','','Naples','FL','34101','USA','','HELPING EVERYONE LIVE A LONGER, HAPPIER, AND HEALTHIER LIFE.','','http://www.nchmd.org/','','',1957),(2100,590704735,'St. Francis Xavier Catholic Church','2055 Heitman St','','Fort Myers','FL','33901','USA','','','','https://www.stfrancisfm.org/','https://www.facebook.com/stfrancisxavierchurchfortmyers/','',1910),(2101,590774200,'St. Luke\'s Episcopal Church','2635 Cleveland Avenue','','Fort Myers','FL','33901','USA','239-334-2479','Saint Luke\'s Church is called to glorify God in traditional worship, proclaiming the Gospel of Jesus Christ, through a loving community.\n\nSaint Luke\'s Church serves God by:\n- Living and offering the Catholic Faith through the historic Liturgy,\n\n- Equipping all members for ministries through the formation of disciples,\n\n- Reaching out to our neighbors with the Good News of God\'s Truth and Love in Jesus Christ,\n\n- Sharing the peace of Christ with each other.','','http://saintlukes-fortmyers.org/','','',NULL),(2102,590806978,'Gulf Coast Humane Society, Inc','2010 Arcadia St','','Fort Myers','FL','33916','USA','239-332-0364','Our mission at Gulf Coast Humane Society is to care for companion pets in need by offering safe refuge, providing medical care and facilitating adoptions.','','gulfcoasthumanesociety.org','Gulf Coast Humane Society','',1947),(2103,590946662,'Wesley Memorial - Ft Myers United Methodist Church','4141 Deleon Street','','Fort Myers','FL','33901','USA','239-936-2200','The Four Areas of Focus express the vision and yearnings of the people of The United Methodist Church. Narrowing our focus to these four areas allows churches to use their resources effectively as they live out God’s vision for the church.\n\nEngaging in Ministry with the Poor\nChrist calls us to be in ministry with the poor and marginalized. Our emphasis is on “with” – standing with those who are regarded as “the least of these,” listening to them, understanding their needs and aspirations, and working with them to achieve their goals. It also means addressing the causes of poverty and responding in ways that lift up individuals and communities. United Methodists believe working side by side with those striving to improve their situation is more effective long term than top-down charity.\n\nImproving Global Health\nKnowing that poverty and health are intertwined, The United Methodist Church has been a key player in fighting diseases such as malaria and AIDS and promoting initiatives that improve well-being. The church had a $75 million goal to provide education, infrastructure, communication and prevention measures to defeat malaria. In fact, the death rate from malaria in Africa has been cut in half, thanks to international efforts such as the denomination’s Imagine No Malaria campaign.  A new “Abundant Health” campaign for the denomination would reach one million children with lifesaving interventions by 2020.\n\nDeveloping Principled Christian Leaders\nThe church needs leaders rooted in Christ, who have a vision for changing the world. Today’s young people have fearless hearts, vibrant ideas and a passion for ministry. Their talents should be nurtured to shape the church’s path into the future. The church must recruit young people — including women and people of color the world over — for ministry, equip them to be effective leaders and be open to where they want to lead us. We also must strengthen lay members, who are ministering at every level of the church.\n\nCreating New and Renewed Congregations\nAround the world, United Methodists are innovating with what it means to be the church, planting new congregations and revitalizing faith communities in every kind of setting. United Methodists seek to re-evangelize the world so that we can reach more people, especially the young and those from diverse backgrounds. By being relevant and vital, United Methodists will touch more lives and draw more people to Christ.','','https://wesleymemumc.com/','Wesley Memorial United Methodist Church-Fort Myers','',NULL),(2104,590968911,'LARC, Inc','2570 Hanson Street','','Fort Myers','FL','33901','USA','239-334-6285','LARC\'s mission is to empower and support individuals with disabilities and their families to achieve their full potential.','','https://larcleecounty.org','LARC, Inc.','',1954),(2105,590973728,'St. Hilary\'s Episcopal Church','5011 McGregor Boulevard','','Fort Myers','FL','33901','USA','239-936-1000','Mission & Meaning\nWe are the faith community you have been looking for - where progressive Christianity meets the tradition of common prayer, social justice and outreach.\n\nSt. Hilary\'s Episcopal Church is committed to befriending followers and non-followers of God, acting in a compassionate manner and being subject to one another. We have learned that honest gestures and beneficence is the most meaningful way to embody the love of God. We invite you to join us.','','http://sainthilarys.org/','','',NULL),(2106,590995499,'Bishop Verot Catholic High School, Inc','5598 Sunrise Dr','','Fort Myers','FL','33919','USA','239-274-6700','Bishop Verot Catholic High School builds relationships centered on faith, learning, and leadership devoted to educating the whole person, utilizing innovative technologies, empowering students through collaborative experiences, and cultivating a spirit of service while grounded in our relationship with Jesus Christ.','','https://bvhs.org/','Bishop Verot Catholic High School','BISHOP VEROT',NULL),(2107,591005169,'United Way of Lee, Hendry, Glades and Okeechobee Counties','7273 Concourse Drive','','Fort Myers','FL','33908','USA','239-433-2000','OUR MISSION:The United Way of Lee, Hendry, Glades, and Okeechobee is a volunteer organization dedicated to improving the quality of life for all people in our community.  Our United Way changes lives for the better. When you invest in United Way, you help people in need. You help make families strong. You feed the hungry. You help children grow and develop to their full potential. You’re there when a man, woman, or child needs a safe haven from domestic violence. You help people get the skills they need to be independent. And, in times of disaster, you ensure that emergency services are there to help people rebuild their lives.','','https://www.unitedwaylee.org/','United Way of Lee, Hendry, Glades, and Okeechobee Counties','',1957),(2108,591022882,'Naples Art Association','585 Park Street','','Naples','FL','34102','USA','239-262-6517','Naples Art has been at the forefront of the Arts & Cultural landscape of Naples s