e together and provide a powerful voice for Everglades restoration at the state and national levels.\nToday, The Everglades Foundation stands as a well-respected authoritative source for scientific research on the Everglades. Our renowned scientists are passionate seekers of the truth, dedicated to unearthing the facts and conducting practical analysis to help local, state and national leaders make well-informed decisions. By coupling sound science with policy expertise, the Foundation is positioned as one of the most influential players in the fight to preserve and restore one of the world’s most unique wetlands.','','https://evergladesfoundation.org/','','',1995),(2158,593334829,'New Horizons Service Dogs, Inc.','1590 Laurel Park Court','','Orange City','FL','32763','USA','386-456-0408','Provide quality, trained service dogs to people with disabilities.\nEducate the public and raise awareness regarding the needs and concerns of persons with disabilities.\nProvide on-going support to a recipient of our dogs and assure a successful working partnership.','','newhorizonsservicedogs.org','New Horizons Service Dogs','NH Service Dogs',1995),(2159,593431008,'AMVETS','2727 Bayshore Dr','Ste 105','Naples','FL','34112','USA','','To enhance and safeguard the entitlements for all American Veterans who have served honorably and to improve the quality of life for them, their families, and the communities where they live through leadership, advocacy and services.','','https://amvets.org/','','',1945),(2160,593546884,'Neighborhood Health Clinic','88 12th Street North','Suite 100','Naples','FL','34102','USA','239-261-6600','Our mission is to deliver quality medical and dental care to low-income, working but uninsured Collier County adults, using a professional volunteer staff and funded by private philanthropy.','','neighborhoodhealthclinic.org','Neighborhood Health Clinic','',1999),(2161,593646095,'Amigos Center','25999 Old 41 Road','','Bonita Springs','FL','34135','USA','(239) 43