es and prepares students intellectually, spiritually and physically to achieve success in life.','','kwc.edu','Kentucky Wesleyan College','Kentucky Wesleyan College',1858),(2167,616027595,'Passionist Nuns of Whitesville Kentucky, Inc','8564 Crisp Road','','Whitesville','KY','42378','USA','270-233-4571','Our vocation as Passionist contemplative nuns is one of union with Mary at the foot of the Cross. Our whole life flows from the personal love of Christ for us manifested in His passion, death and resurrection. We seek to comfort Him in His Sacred Passion by loving our Sisters in community life and through Divine Worship. This is expressed most powerfully in our participation in the Holy Mass which is the highpoint of our monastic day. Through this union with our Sacramental Spouse in the Eucharist we are empowered to persevere in this loving union with Christ Crucified. Mission in the church of prayer and promoting devotion to the Passion of Christ.','','https://www.passionistnuns.org/home','Passionist Nuns of St. Joseph Monastery','',NULL),(2168,620646012,'St. Jude Children\'s Research Hospital','501 St. Jude Place','','Memphis','TN','38105','USA','','The mission of St. Jude Children’s Research Hospital is to advance cures, and means of prevention, for pediatric catastrophic diseases through research and treatment. Consistent with the vision of our founder Danny Thomas, no child is denied treatment based on race, religion or a family\'s ability to pay.','','https://www.stjude.org/','','',NULL),(2169,630598743,'Southern Poverty Law Center','400 Washington Avenue','PO Box 548','Montgomery','AL','36177','USA','334-956-8200','Civil rights lawyers Morris Dees and Joseph Levin Jr. founded the SPLC in 1971 to ensure that the promise of the civil rights movement became a reality for all. Since then, we’ve won numerous landmark legal victories on behalf of the exploited, the powerless and the forgotten.\n\nOur lawsuits have toppled institutional racism and stamped out remnants of Jim Crow segregation; destroyed some of the nation’s most violent white supremacist groups; and protected the civil rights of children, women, the disabled, immigrants and migrant workers, the LGBT community, prisoners, and many others who faced discrimination, abuse or exploitation.\n\nOur Intelligence Project is internationally known for tracking and exposing the activities of hate groups and other domestic extremists.\n\nOur Teaching Tolerance program produces and distributes – free of charge – anti-bias documentary films, books, lesson plans and other materials that reduce prejudice and promote educational equity in our nation’s schools.\n\nWe also built and maintain the Civil Rights Memorial and its interpretive center, the Civil Rights Memorial Center, in Montgomery, Alabama, the birthplace of the modern civil rights movement.\n\nWe’re based in Montgomery and have offices in Atlanta, Miami, New Orleans, and Jackson, Miss.','','https://www.splcenter.org/about','Southern Poverty Law Center','Southern Poverty Law Center',1971),(2170,650007620,'Children\'s Advocacy Center of SW Florida, Inc','3830 Evans Avenue','','Fort Myers','FL','33901','USA','239-939-2808','Founded in 1981, the mission of the Children’s Advocacy Center of Southwest Florida (CAC) is to provide a coordinated response to child victims of abuse and neglect; and improve the lives of at-risk children and their families through prevention services. At CAC, we assess and treat children believed to have been physically or sexually abused or to be at-risk of such abuse, and a provide a safe place for them to come and be heard. We offer abuse determination services as well as therapeutic counseling, parenting education and prevention programs in Lee, Hendry, Glades and Charlotte Counties.','','https://www.cac-swfl.org/','Children\'s Advocacy Center of Southwest Florida, Inc.','',1984),(2171,650032845,'Sanibel Music Festival, Inc','PO Box 1623','','Sanibel','FL','33957-1623','USA','866-776-0910','Th