ide sooner.','','https://www.specialequestrians.net/about/','Special Equestrians, Inc','Special Equestrians',1991),(2181,650260414,'Immokalee Church of the Nazarene Inc','803 W Main St','','Immokalee','FL','34142','USA','','We aim to take a different approach in reaching out\nand helping people along the journey.','','http://www.icnonline.org/','','',1963),(2182,650290568,'Partners for Breast Cancer Care, Inc.','9470 Healthpark Circle','','Fort Myers','FL','33908','USA','239-454-8583','Partners for Breast Cancer Care, Inc. is a unique organization that is dedicated to serving our community’s women and men who desperately need our help. We fund breast screening, diagnostic testing and treatment for underserved women and men in Lee, Hendry, Glades, Collier and Charlotte Counties at no cost to them. Our clients are carefully screened for qualification. We are a “one-of-a-kind” organization offering no-cost breast health care to eligible residents, many of whom have nowhere else to turn for assistance.','','https://pfbcc.org/about/','Partners for Breast Cancer Care','PFBCC',1991),(2183,650295085,'Center for the Arts of Bonita Springs, Inc','26100 Old 41 Road','','Bonita Springs','FL','34135','USA','(239) 495-8989','The Centers for the Arts of Bonita Springs is committed to enrich the culture of our diverse communities by providing opportunities for artistic expression, education and appreciation in a supportive and nurturing environment.','','http://www.artcenterbonita.org/','https://facebook.com//pages/Center-for-the-Arts-of-Bonita-Springs/1274-00273351','https://twitter.com//#!/artcenterbonita',1992),(2184,650308014,'Gabriel House, Inc','6900 Daniels Pkwy','','Fort Myers','FL','33912','USA','','The Mission is to provide a loving and supportive home atmosphere for children who have been abandoned, neglected physically, emotionally and medically. This residential home focuses on children from birth to six years old. It is geared to help children reach their very highest