 anywhere in between, help is available.\n\nPregnancy help centers are local, non-profit organizations that provide support and assistance to women and men faced with difficult pregnancy decisions. In addition to free pregnancy tests, peer counseling and referrals, most centers offer classes on pregnancy, childbirth, parenting, and life skills.','','https://floridapregnancysupport.com/centers/verity-inc/','','',NULL),(2187,650403969,'Florida Gulf Coast University Foundation, Inc','10501 FGCU Boulevard S.','','Fort Myers','FL','33905','USA','239-590-1854','The FGCU Foundation is the channel for private gifts to FGCU through annual giving programs, planned gifts (outright gifts such as securities or real estate or deferred gifts through wills and trusts), and capital and other special-purpose campaigns. The Foundation\'s principal responsibilities are to raise awareness of the need for private support, to solicit gifts on behalf of FGCU and exercise fiduciary management of those gifts.','','','','',1994),(2188,650403969,'WGCU Public Media','10501 FGCU Boulevard S','','Fort Myers','FL','33965','USA','239-590-2300','WGCU Public Media is Southwest Florida\'s source for PBS and NPR. WGCU provides quality programming 24-hours a day and is a trusted story teller, teacher, theater, library and traveling companion. As a member-supported service of Florida Gulf Coast University, WGCU’s mission is to provide educational programming that inspires, informs and engages our community.','','http://www.wgcu.org/home/','','',NULL),(2189,650460581,'O Bannon Snook Tournament at Cabbage Key, Inc','PO Box 1631','','Fort Myers','FL','33902','USA','239-283-2278','The Fingers O’Bannon Memorial Fishing Tournament is a prestigious invite-only tournament dedicated to the life and memory of the late Floyd ‘Fingers’ O’Bannon and devoted to raising money for AMI Kids on Fort Myers Beach and the Marine Science program at FGCU. AMIkids is a non-profit organization dedicated to helping youth develop 