g to stable, happy, and productive lives by providing a safe and nurturing home, education, parenting support, along with physical, mental and spiritual care.','','ourmothershome.com','','',1994),(2194,650525360,'Wishing Well Foundation, Inc','4301 Gulfshore Boulevard N','Apt 1004','Naples','FL','34103','USA','239-213-0397','Wish-granting for children with life threatening illnesses. The Wishing Well Foundation, Inc. is committed to creating cherished moments for those special children here in Collier & Lee Counties and to offer ongoing love and support to their families. Offers volunteer opportunities in wish granting, including a kid\'s club for younger volunteers.','','http://www.swflresourcelink.com/provider/wishing-well-foundation','','',NULL),(2195,650529641,'Lifeline Family Center, Inc','907 SE 5th Avenue','','Cape Coral','FL','33990','USA','239-242-7238','Lifeline Family Center offers a positive alternative to abortion, giving both mother and baby hope for the future.','','lifelinefamilycenter.org','Lifeline Family Center','Lifeline Family',1996),(2196,650536169,'InStride Therapy, Inc.','1629 Ranch Road','','Nokomis','FL','34275','USA','941-412-9333','Partnering with our horses, we challenge individuals of ALL ABILITIES to reach their fullest potentialInStride Therapy is a nonprofit organization that specializes in providing equine-assisted activities and therapies to individuals with unique challenges.  InStride was founded in 1995, and since then has served thousands of children and adults through hippotherapy (physical, occupational, and speech therapy), therapeutic riding, Special Olympics, equine-assisted learning, veterans, and literacy programs.','','instridetherapy.org','InStride Therapy, Inc.','InStride Therapy',1994),(2197,650565226,'Calusa Waterkeeper, Inc.','PO Box 1165','','Fort Myers','FL','33902','USA','239-784-0880','Calusa Waterkeeper, Inc. is a non-profit organization dedicated to the protection of the Caloosahatchee River & Estuary, Lake Okeechobee, Nicodemus Slough, Charlotte Harbor, Estero Bay, the near-shore waters of Lee County, and their watersheds, through education and promotion of responsible use and enjoyment by all people.\nOur Goals and Objectives\nTo strive to improve the waters of our jurisdiction, including its impacts on riparian and estuarine systems, wildlife habitat, and marine life.\nTo promote public education concerning the historical significance, present condition, and future of our water bodies and watersheds.\nTo increase public awareness of the importance of our waters to our quality of life.\nTo study the effect of domestic, commercial, and agricultural uses of our water resources.\nTo monitor and work to improve water quality, quantity, and flow characteristics.\nTo observe and participate in the activities of public bodies responsible for the management of our waters and our watersheds.\n','','https://calusawaterkeeper.org/','CalusaWaterkeeper','calusawater',1995),(2198,650569413,'Theatre Conspiracy, Inc.','10091 McGregor Boulevard','','Fort Myers','FL','33919','USA','239-939-2787','Our senses of hearing and sight connect us to people, the arts, music, theatre and our environment. Theatre Conspiracy at the Alliance for the Arts is committed to providing an enjoyable theatre-going experience for all patrons. Our theatre is wheelchair accessible, and in addition, the Alliance for the Arts provides amplified audio and offers audio described performances during the select shows.','','https://www.artinlee.org/','','',NULL),(2199,650610872,'Americans for Immigrant Justice','6355 NW 36 Street','Suite 2201','Miami','FL','33166','USA','(305) 573-1106','Americans for Immigrant Justice is an award-winning non-profit law firm that protects and promotes the basic human rights of immigrants. In Florida and on a national level, it champions the rights of unaccompanied immigrant children; advocates for survivors of trafficking and domestic violence; serves as a watchdog on immigration detention practices and policies; and speaks for immigrant groups who have particular and compelling claims to justice.','','http://www.aijustice.org/','https://facebook.com/AIJustice.org','https://twitter.com/Am4ImmJustice',1996),(2200,650645343,'Lee Memorial Health System Foundation, Inc','9800 South HealthPark Drive','Suite 405','Fort Myers','FL','33908','USA','239-343-6950','Lee Health Foundation serves as the philanthropic fundraising arm of Lee Health, a comprehensive healthcare system serving the ever growing needs of Southwest Florida. Lee Health Foundation supports fundraising efforts to support Lee Health\'s four acute care facilities - Lee Memorial Hospital, Cape Coral Hospital, Gulf Coast Medical Center, HealthPark Medical Center - as well as the system\'s children\'s hospital, Golisano Children\'s Hospital of Southwest Florida, and the new Lee Health - Coconut Point facility in South Lee County. Lee Health Foundation seeks investments from the community to support capital and programmatic needs to help the system improve the lives and well-being of the Southwest Florida community.','','https://leehealthfoundation.org','Lee Health Foundation','Lee Health Foundation',NULL),(2201,650666748,'Gulf Coast Symphony Orchestra, Inc','PO Box 60878','','Fort Myers','FL','33906','USA','239-277-1700','The Gulf Coast Symphony exists to contribute to the cultural enrichment of Southwest Florida by producing and performing a broad variety of concerts and creating a diverse, innovative, and balanced program of performances, events, and community and education projects that reaches the widest possible public. The primary goals of the Gulf Coast Symphony are:\n\n- To help build general arts awareness in Southwest Florida\n- To develop new audiences for the arts in our community\n- To assist in the development of potential future performers','','gulfcoastsymphony.org','Gulf Coast Symphony','Gulf Coast Symphony',1996),(2202,650753801,'Florida Gulf Coast University','10501 FGCU Boulevard S.','','Fort Myers','FL','33965-6565','USA','239-590-1000','Florida Gulf Coast University, a comprehensive institution of higher education, offers undergraduate and graduate degree programs of strategic importance to Southwest Florida and beyond. FGCU seeks academic excellence in the development of selected programs and centers of distinction in science, technology, engineering and mathematics (STEM) disciplines, health professions, business, and marine and environmental sciences. Outstanding faculty and staff supported by a strong community of advisors prepare students for gainful employment and successful lives as responsible, productive and engaged citizens. FGCU emphasizes innovative, student-centered teaching and learning, promotes and practices environmental sustainability, embraces diversity, nurtures community partnerships, values public service, encourages civic responsibility, and cultivates habits of lifelong learning and the discovery of new knowledge.','','','','',NULL),(2203,650785751,'Reef Ball Foundation, Inc.','890 Hill Street','','Athens','GA','30606','USA','706-714-4399','is a 501(c) 3 publicly supported non-profit and international environmental NGO working to rehabilitate marine reefs. Our mission is to rehabilitate our world\'s ocean reef ecosystems and to protect our natural reef systems using Reef Ball designed reef technologies.\n\nWe have placed well over 1/2 million Reef Balls™ and conducted over 6,000 projects in 62+ countries with a global reach of 70+ countries. Our projects include designed artificial reefs, ground-breaking coral propagation and planting systems, estuary restoration, red mangrove plantings, oyster reef restoration, erosion control, and expert collaboration on a variety of oceanic issues.  We work with governments, other NGOs, businesses, schools, research institutes, private individuals and community organizations and emphasize education on preserving and protecting our natural reefs.','','http://www.reefball.org/index.html','','',1993),(2204,650822909,'Project Dentists Care Inc.','PO Box 60424','','Fort Myers','FL','33906','USA','850-681-3629','The mission of PDC is to establish dental-access programs statewide. Patients who receive services under PDC are typically low-income individuals that don\'t qualify for public assistance but have the greatest unmet needs.','','https://www.floridadental.org/foundation/programs/project-dentists-care','Florida Dental Association','Florida Dental Assoc',2007),(2205,650827621,'Florida Repertory Theatre','PO Box 2483','','Fort Myers','FL','33902','USA','239-332-4665','Florida Rep is committed to providing a first-class regional theatre for Southwest Florida; to creating, nurturing and developing an ensemble of theatre professionals who will develop long term relationships working on a wide variety of plays; to helping improve the quality of life in our community through all the arts; and to making the arts, especially theatre, accessible to all.','','https://www.floridarep.org/','Florida Repertory Theatre','FloridaRep',1998),(2206,650960136,'Iona-Hope Episcopal Church','9650 Gladiolus Dr','','Fort Myers','FL','33908','USA','','welcome all people just as we have been created by God.  No matter where you are on your journey of faith and no matter whether you are single, married, divorced, separated, or partnered, our welcome knows no boundaries of age, race, ethnicity, culture, gender or gender expression, sexual orientation, economic condition, physical or mental ability.  We believe that God delights in the diversity of creation as so do we.','','http://www.ionahope.org/','','',1999),(2207,651110501,'St. Matthew\'s House, Inc','2001 Airport Road S','','Naples','FL','34112','USA','239-774-0500','Our Mission\nTo change lives in a spiritual environment that is both compassionate and disciplined as we provide housing for the homeless, food for the needy, and comfort for the addicted and suﬀering.\n\nOur Vision\nTo become a model agency to provide services and resources to the homeless, hungry, and addicted while seeking to expand the capacity to meet present and future needs in the most eﬀective and efficient manner.','','https://stmatthewshouse.org/','St. Matthew\'s House','St. Matthew\'s House',NULL),(2208,651119729,'ArtFest Fort Myers, Inc','1375 Jackson Street','Suite 401','Fort Myers','FL','33901','USA','239-768-3602','ArtFest Fort Myers is best known for its annual juried fine art festival, which nurtures the artistic and cultural environment of our entire community','','ARTFESTFORTMYERS.COM','ArtFestFortMyers','',2002),(2209,743076772,'Patterson Dental Foundation','1031 Mendota Heights Road','','Saint Paul','MN','55120','USA','651-686-1725','The mission of the Patterson Foundation is to positively impact lives through higher education scholarships to children of Patterson Companies employees and grants to nonprofit organizations in the oral health and animal health fields.','','http://pattersonfoundation.net/','','',NULL),(2210,751835298,'Susan G. Komen Breast Cancer Foundation','4061 Bonita Beach Road','Suite 103','Bonita Springs','FL','34134','USA','','OUR MISSIONSave lives by meeting the most critical needs in our communities and investing in breakthrough research to prevent and cure breast cancer.','','https://ww5.komen.org/','Susan G. Komen','Susan G. Komen',1982),(2211,760730192,'Museum of New Jersey Maritime History, Inc','528 Dock Rd','','Beach Haven','NJ','8008','USA','609-492-0202','This corporation is a museum and research facility organized exclusively for educational purposes within the meaning of Section 501(c)(3) of the Internal Revenue Code. This corporation’s educational purposes include, among other things, providing a facility for the public display of a significant number of marine artifacts. The display of said artifacts will encourage maritime research, historical instruction by guest lecturers and promote the education of the public about New Jersey’s maritime history.','','njmaritimemuseum.org','New Jersey Maritime Museum','',2005),(2212,800887392,'Arts of the Inland','PO Box 1302','','LaBelle','FL','33975','USA','(239) 843-2929','We are Visual, Literary and Performing Artists of the inland communities of South Florida.  As a 501(c)(3) organization, the Arts of the Inland, along with our patrons and sponsors, are committed and dedicated to recognizing the talent and power of artists in this special area','','https://www.artsinland.com/','https://www.facebook.com/Barron-Park-House-Gallery-Gift-Shop-181001535619467/?hc_ref=ARRjhoO1wDPmSECIuvCWiAZUICVjJ7s7OQd75qO8lDLWRLyhqj1amm9z4kAO6iMlHUY','',2014),(2213,810472959,'Camp Mak-A-Dream','PO Box 1450','','Missoula','MT','59806','USA','406-549-5987','Camp Mak-A-Dream empowers survivors and their families to live with and beyond cancer through life-changing Montana experiences where they strengthen life skills, gain resilience and develop lasting relationships.','','https://www.campdream.org/','Camp Mak-A-Dream','Camp Mak-A-Dream',1991),(2214,810704176,'Healing Towers Inc','11547 Longshore Way East','','Naples','FL','34119','USA','(256) 302-2347','Healing Towers based in Ketchikan, Alaska impacts disabled veterans throughout their journey of recovery. We rely on mentorship, camaraderie and the great outdoors to create a foundation in which disabled veterans may refocus their lives post-injury.','','http://www.healingtowers.org/','','',2017),(2215,810830144,'3WM Foundation','1804 Garnet Ave.','','San Diego','CA','92109','USA','','To provide advocacy, awareness and alliances needed for every veteran to succeed in the modern world.','','','','',2015),(2216,811789969,'Captains for Clean Water, Inc','2031 Jackson Street','','Fort Myers','FL','33901','USA','866-670-2329','Advancing education, awareness, and scientifically-supported solutions to restore and protect marine ecosystems and our way of life for future generations.','','https://captainsforcleanwater.org/','CaptainsForCleanWater','Capt4CleanWater',2016),(2217,813632884,'Cape Coral Animal Shelter','325 SW 2nd Avenue','','Cape Coral','FL','33991','USA','239-800-9752','The Cape Coral Animal Shelter mission is to engage a special bond between people and animals by means of adoption services, medical care, education and training for the prevention of cruelty and abandonment. A safe place, where animals will remain in our care until they are placed in a qualified, forever home.','','https://www.capecoralanimalshelter.com/','CapeCoralAnimalShelter','',2016),(2218,814381275,'Wolfhounds Legacy','229 NW 22nd Pl','','Cape Coral','FL','33993','USA','','Our mission is to train rescue dogs and pair them with a veteran with PTSD. We are saving two lives at a time.','','','','',NULL),(2219,814520649,'Veterans Club of Jamaica Bay Inc','8 Rapine Ct','','Fort Myers','FL','33912','USA','','TO PROMOTE AND HELP VETERANS','','','','',2019),(2220,814703797,'Emmanuel Communities, Inc.','777 Mooring Line Drive','','Naples','FL','34102','USA','239-261-0894','Emmanuel Communities, Inc. was founded by Emmanuel Lutheran Church of Naples, FL to develop and manage Faith Based Communities seeking health, joy, spiritual growth and social and service engagement.','','emmanuelpark.org','','',2016),(2221,814762080,'Beyond Wellness Club, Inc','2925 Cypress Trace Circle','#204','Naples','FL','34119','USA','239-290-9601','We work hard to empower people to strive for vibrant health by providing education on holistic, alternative, and frequency therapies along with natural nutrition advice that will help with disease prevention and healing. Bettering your health is an emotional journey, and we are here to uplift and empower you to strive to keep and maintain your health. \n','','https://powerofhealthcenter.org/about','Power Of Health Center','',2017),(2222,815352805,'Newtown Square in Bloom','P.O. Box 592','','Newtown Square','PA','19073','USA','','America in Bloom originated in Europe and Canada and introduced its United States organization in 2001. The all-volunteer program seeks to promote civic pride through planting trees, shrubs and flowers and improving a community’s overall quality of life by working with other volunteer organizations and businesses within the community.','','newtownsquareinbloom.com','Newtown Square in Bloom','',NULL),(2223,820664915,'Veteran Excursions To Sea Inc','320 Kensington St','','Port Charlotte','FL','33954','USA','(941) 421-4665','To provide veterans and their families with a day on the water, in hopes that they will find peace and composure on the water.','','http://veteranexcursions.com/','https://www.facebook.com/pg/veteranexcursionstosea/about/?ref=page_internal','',2017),(2224,821512029,'Impac Fund Inc','121 Alhambra Plz','Ste 1100','Coral Gables','FL','33134','USA','','THE IMPAC FUND FOCUSES ON FAMILY UNITY AND WORKS TOWARDS PROTECTING THE INDIVIDUAL RIGHTS OF IMMIGRANTS.IMPAC BRINGS TOGETHER BUSINESS AND CIVIC LEADERS IN FLORIDA WHO SUPPORT POLICIES AND PRACTICES THAT RECOGNIZE THE IMPORTANT CONTRIBUTIONS THAT IMMIGRANTS MAKE TO OUR ECONOMY AND OUR COMMUNITIES. OUR ORGANIZATION\'S EFFORTS WILL BE FOCUSED TOWARDS FUNDRAISING FOR THE DEFENSE OF NON-FELON UNDOCUMENTED RESIDENTS TO PROTECT FAMILIES. WE RECOGNIZE THE IMPORTANCE THAT IMMIGRANTS REPRESENT TO THE FIBER OF OUR COMMUNITY AND ITS ECONOMIC WELLBEING.','','https://impacfund.org/','https://www.facebook.com/impacfund/','https://twitter.com/IMPAC_FUND',2017),(2225,825156089,'Depth Ministries, Inc.','5576 Doug Taylor Circle','Unit 143','Saint James City','FL','33956','USA','(615) 267-3722','Depth Ministries strives to awaken, revive and renew people to live like Jesus as they provide hope to their families, churches and community. We desire to build community and love our neighbors as we live life day by day.','','http://www.depthministries.org/','https://facebook.com/depthmininstries.org','',2018),(2226,825472732,'Gulf Coast Veterans & Friends Inc','15920 Old 41','Suite 300','Naples','FL','34110','USA','(802) 558-7648','We here at GCVF are \"Embracing Those Who Served\" by fulfilling our Incorporated organization\'s Mission of providing support, mentoring and fostering relationships between our local veterans and our community. Our goal is to foster relationships, identify needs and gaps in current veteran resources and form support groups. We will work to assist veterans of all ages in any way that we can.','','http://gulfcoastvf.org/','','',2020),(2227,831166021,'Veterans Initiative for Therapeutic Arts Inc','227 Sullivan St','','Punta Gorda','FL','33950','USA','(941) 626-8630','Veterans Initiative for Therapeutic Arts’ mission is to promote creative writing, musical, and visual arts disciplines as a progressive art form and therapeutic outlet for Veterans to learn, experiment, and collaborate. VITA will provide instruments, art and writing supplies, instruction and an inclusive environment where local veterans can create.','','http://www.vitaarts.org/','','',2018),(2228,832329552,'Church of the Creator Inc','3100 Del Prado Blvd S','# 203','Cape Coral','FL','33904','USA','','Our Church makes every effort to become a substantial non-state provider of educational and medical services, as well as a supplier of food, clothing, and an assistant to the construction of housing for the homeless, poor and needy. Church of the Creator it is tax-exempt charity under section 501(c)(3). Sunnyan spiritual teaching includes the distribution of Sunnyanity, while Sunnyan social education emphasizes the support of all sick, poor, and suffering creatures of God, through physical and spiritual works of charity.','','https://www.church-of-the-creator.org/','https://facebook.com/churchofthecreator','https://twitter.com/Sunnyanity',2019),(2229,832417718,'Women United for Women, Inc.','PO Box 34178','','Indialantic','FL','32903','USA','','Warrior Women United is a national nonprofit 501(c)(3) organization which supports women who are active duty military, law enforcement, first responders, veterans or military spouses. Our team is comprised of experienced, caring individuals who are servant leaders that want to help their sisters thrive and live their very best lives. Our experiential in-person and virtual programs are offered free to women who have served their country and their communities. Their struggles are our struggles. We owe it to them to provide a safe space and tools to deal with the anxiety, stress, and trauma they have experienced. Because they deserve it.','','','','',NULL),(2230,832944934,'Benefit Earth, Inc','9380 Los Alisos Way','','Fort Myers','FL','33908','USA','239-935-5505','We believe in supporting the artisan spirit at Market Earth through local artists, fair trade partners and recyclers from around the world. We strive to find unique products that share our visions of supporting a global marketplace with exceptional standards of quality and creativity. All our goods represent our philosophy of social awareness and we are proud to be a purveyor of change in the way we treat this beautiful earth and all the people, everywhere, who live on it.','','https://marketearthstore.com/','OneTree.org','',2019),(2231,832956050,'Our Daily Bread Food Pantry, Inc','1450 Winterberry Drive','','Marco Island','FL','34145','USA','239-259 5188','Our Daily Bread Food Pantry exists to share the love of God by reducing hunger and building relationships in our community. Our goal is to offer nourishing food choices, encouragement, and hope.','','ourdailybreadfoodpantry.com','Our Daily Bread Food Pantry','Our Daily Bread Food Pantry',2019),(2232,833640100,'Blue Star Mothers Gulf Coast FL12','12850 Pastures Way','','Fort Myers','FL','33913','USA','(404) 403-7565','To support our fellow military Mothers, offer help to military families and Veterans, and to support our military men and women in our own community and throughout the world.','','http://gcfbsm.weebly.com/','','',2004),(2233,843024608,'Bridge To A Cure Foundation Inc','4135 SW 8th Pl','','Cape Coral','FL','33914','USA','','Bridge To A Cure Foundation Founder and President Robert (Bob) Martin understands the flaws in our healthcare system. He knows why cancer research is failing our children — so much so that just three new childhood cancer treatments have been developed in the past 40 years. His granddaughter, Clara, was stricken with a form of brain cancer at just 4 years old. In seeking a cure for her, he uncovered several serious shortfalls in America’s approach to childhood cancer research and treatment.','','http://www.bridgetoacure.org/','https://www.facebook.com/BTACfoundation/','https://twitter.com/btacfoundation',2020),(2234,850131810,'Santa Fe Opera','301 Opera Drive','','Santa Fe','NM','87506','USA','505-986-5900','The Santa Fe Opera\'s mission is to advance the operatic art form by presenting ensemble performances of the highest quality in a unique setting with a varied repertoire of new, rarely performed, and standard works; to ensure the excellence of opera\'s future through apprentice programs for singers, technicians and arts administrators; and to foster an understanding and appreciation of opera among a diverse public.','','https://www.santafeopera.org','Santa Fe Opera','Santa Fe Opera',1957),(2235,850402649,'Upaya Zen Center','1404 Cerro Gordo Rd','','Santa Fe','NM','87501','USA','505-986-8518','Upaya Zen Center is a model of socially engaged Buddhism. It brings together many projects focused on social transformation, including work in prisons, end-of-life care, serving the homeless, training of chaplains in socially engaged practice, peace and non-violence work, training of clinicians all over the world in compassionate care, and delivering healthcare in remote regions of the Himalayas.\n\nUpaya is a global community for those working to create racial, economic, and environmental justice, compassionate care for the most vulnerable, and a place of committed, daily contemplative practice and learning through its retreats, trainings, and programs, free Dharma podcasts and community services.','','https://www.upaya.org/','Upaya Zen Center','Upaya Zen Center',NULL),(2236,943249793,'Pachamama Alliance','PO BOX 29191','','San Francisco','CA','94129','USA','415-561-4522','To empower indigenous people of the Amazon rainforest to preserve their lands and culture and, using insights gained from that work, to educate and inspire individuals everywhere to bring forth a thriving, just and sustainable world.','','https://www.pachamama.org/about/mission','Pachamama Alliance','Pachamama Alliance',1996),(2237,943467822,'PAWS Lee County, Inc.','965 Pondella Road','','N Ft Myers','FL','33903','USA','239-652-6722','We are a 501(c)3 Non-Profit Organization.  Our mission is to educate our community about the importance of spaying and neutering their pets to control pet overpopulation, homelessness, and neglect.','','http://pawsofleecounty.blogspot.com/','Paws Leecounty','',2009),(2238,946069890,'Sierra Club Foundation','1990 Central Avenue','','St. Petersburg','FL','33712','USA','727-824-8813','A chapter of the national Sierra Club, Sierra Club Florida is made up of volunteer leaders and civic activists representing over 32,000 members from all over the state. Our  mission is to enjoy, explore and protect the natural places in Florida, to teach others to understand and respect the fragile environment in which we live, and to practice and promote the responsible use of Florida’s ecosystems and resources. The strength of the Chapter comes from the efforts of local, grass-roots volunteers in the 16 Sierra Club Groups across the state. Look for Groups under Inside the Chapter tab to find your local group.','','https://www.sierraclub.org/florida','Sierra Club Florida','Sierra Club Florida',1960),(2239,951696720,'Francis Parker School','6501 Linda Vista Rd','','San Diego','CA','92111','USA','','The Francis Parker School mission is to create and inspire a diverse community of independent thinkers whose academic excellence, global perspective, and strength of character prepare them to make a meaningful difference in the world.\n\nFrancis Parker School is committed to graduating students who embody those qualities essential for academic success and personal fulfillment — intellectual curiosity, creative thinking, passion for learning, ethical responsibility, self-reliance, community engagement, and global competence — by offering a balanced, challenging, and integrated Junior Kindergarten through Grade 12 educational program in academics, athletics, and the arts, all centered in a vibrant and diverse school environment.','','francisparker.org','Francis Parker School','FrancisParkerSchool',1912),(2240,954338997,'New Mission Systems, Inc','2701 Cleveland Avenue','Suite 200','Fort Myers','FL','33901','USA','800-323-9473','Enhancing Trust in Christ-Centered Churches and Ministries','','ecfa.org','Evangelical Council for Financial Accountability','ECFA',1989),(2241,956044429,'San Diego Opera Association','233 A Street,','Ste. 500','San Diego','CA','92101','USA','619-232-7636','The mission of San Diego Opera is to deliver exceptional vocal performances and exciting, accessible programs to diverse audiences, focusing on community engagement and the transformative power of live performance.','','https://www.sdopera.org/','San Diego Opera','San Diego Opera',1953);
